    hour = '0'
    minute = '0'
    sec = '0'
    if newdate[1] < 10:
       month='0'+str(newdate[1])
    else:
       month=str(newdate[1])

    if newdate[2]<10:
        day='0'+str(newdate[2])
    else:
        day=str(newdate[2])

    if newdate[-3]<10:
        hour='0'+str(newdate[-3])
    else:
        hour=str(newdate[-3])

    if newdate[-2]<10:
        minute='0'+str(newdate[-2])
    else:
        minute=str(newdate[-2])

    if newdate[-1]<10:
        sec='0'+str(newdate[-1])
    else:
        sec=str(newdate[-1])


